import React from "react";
import macbook from "./HelloMacBook.mp4"

const Main = () => {
    return (
        <div className="w-full h-screen bg-[#f8f7f3]">
            <div className="w-full h-2/3 flex justify-center items-start">
            <video>
                <source src={macbook} type="video/mp4" />
            </video>
            </div>
            <div className=""></div>
        </div>
    )
}

export default Main
